contract Victim {
    function isItAContract() public view returns (bool) {
        // if the bytes of code are greater than 0 then it is a contract
        uint32 size;
        address a = msg.sender;
        assembly {
            size := extcodesize(a)
        }

        return (size > 0);
    }
